<?php
    date_default_timezone_set('UTC');
    $user_query = $_GET["query"];
    $user_inp_num = preg_replace('/[^0-9]/', '', $user_query);
    $user_inp_char = preg_replace('/[^a-zA-Z ]/', "",$user_query);
    session_start();
    $_SESSION["query"] = $user_query;
    $keyword_temp = split(' ',$user_query);
    $keyword = array();
    function count_qtf($search_key,$keyword){
        $qtf = 0;
        for($i=0;$i<count($keyword);$i++){
            if($search_key == $keyword[$i]){
                $qtf++;
            }
        }
        return $qtf;
    }
    function compare($docs,$search){
        $pos = strpos($docs,$search);
        if($pos === false){
            return false;
        }else{
            return true;
        }
    }
    function count_df($search_key,$documents){
        $df = 0;
        for($i=0;$i<count($documents);$i++){
            $courseName = preg_replace('/[^0-9a-zA-Z]/', '', strtolower($documents[$i]->courseName));
            $instuctor = preg_replace('/[^0-9a-zA-Z]/', '', strtolower($documents[$i]->instructor));
            $schedule = preg_replace('/[^0-9a-zA-Z]/', '', strtolower($documents[$i]->schedule));
            $credit = preg_replace('/[^0-9a-zA-Z]/', '', strtolower($documents[$i]->credit));
            $college = preg_replace('/[^0-9a-zA-Z]/', '', strtolower($documents[$i]->college));
            $department = preg_replace('/[^0-9a-zA-Z]/', '', strtolower($documents[$i]->department));
            $describe = preg_replace('/[^0-9a-zA-Z]/', '', strtolower($documents[$i]->descirbe));
            if(compare($courseName,$search_key) || compare($instuctor,$search_key) || compare($schedule,$search_key) || compare($credit,$search_key) || compare($college,$search_key) || compare($department,$search_key) || compare($describe,$search_key)){
                $df++;
            }
        }
        return $df;
    }
    function count_word($string,$keyword){
        $words = array();
        $count = 0;
        $words = str_word_count($string,1);
        for($i=0;$i<count($words);$i++){
            if($keyword == strtolower($words[$i])){
                $count++;
            }
        }
        return $count;
    }
    function count_dl($string){
        $words = array();
        $words = str_word_count($string,1);
        return count($words);
    }
    if(count($keyword_temp)!=0){
        for($i=0;$i<count($keyword_temp);$i++){
            $words_db = new PDO("sqlite:../web_data/non_use_words.db");
            $words_db->setAttribute(PDO::ATTR_ERRMODE, 
                           PDO::ERRMODE_EXCEPTION);
            $query = "select word from words where word=:word";
            $statement=$words_db->prepare($query);
            $statement->bindParam(":word",strtolower($keyword_temp[$i]));
            $statement->execute();
            $exist = count($statement->fetchAll(PDO::FETCH_OBJ));
            if($exist == 0){
                if($keyword_temp[$i] != ""){
                    array_push($keyword,strtolower($keyword_temp[$i]));
                }
            }
        }
        //for($i=0;$i<count($keyword_temp);$i++){
        //    if($keyword_temp[$i] != ""){
        //        array_push($keyword,strtolower($keyword_temp[$i]));
        //    }
        //}
        if(count($keyword)!=0){
            $course_db = new PDO("sqlite:../web_data/class_info.db");
            $course_db->setAttribute(PDO::ATTR_ERRMODE, 
                           PDO::ERRMODE_EXCEPTION);
            $query = "select * from courses where ";
            for($i=0;$i<count($keyword);$i++){
                $keyword_t[$i] = "courseName like '%".$keyword[$i]."%' or instructor like '%".$keyword[$i]."%' or schedule like '%".$keyword[$i]."%' or credit like '%".$keyword[$i]."%' or resource like '%".$keyword[$i]."%' or college like '%".$keyword[$i]."%' or department like '%".$keyword[$i]."%' or describe like '%".$keyword[$i]."%'";
                if($i != count($keyword)-1){
                    $query = $query.$keyword_t[$i]." or ";
                }else{
                    $query = $query.$keyword_t[$i];
                }
            }
            $statement=$course_db->prepare($query);
            $statement->execute();
            $documents = $statement->fetchAll(PDO::FETCH_OBJ);
        }
        $index_value = array();
        for($i=0;$i<count($keyword);$i++){
            $qtf = 0;
            $df = 0;
            $qtf = count_qtf($keyword[$i],$keyword);
            $df = count_df($keyword[$i],$documents);
            $index_value[$i]["qtf"] = $qtf;
            $index_value[$i]["df"] = $df;
        }
        $tf = array();
        $docLen = array();
        for($i=0;$i<count($documents);$i++){
            for($j=0;$j<count($keyword);$j++){
                $tf[$i][$keyword[$j]] = count_word($documents[$i]->courseName,$keyword[$j]) + count_word($documents[$i]->instructor,$keyword[$j]) + count_word($documents[$i]->schedule,$keyword[$j]) + count_word($documents[$i]->credit,$keyword[$j]) + count_word($documents[$i]->resource,$keyword[$j]) + count_word($documents[$i]->college,$keyword[$j]) + count_word($documents[$i]->department,$keyword[$j]) + count_word($documents[$i]->describe,$keyword[$j]);   
            }
            $docLen[$i] = count_dl($documents[$i]->courseName) + count_dl($documents[$i]->instructor) + count_dl($documents[$i]->schedule) + count_dl($documents[$i]->credit) + count_dl($documents[$i]->resource) + count_dl($documents[$i]->college) + count_dl($documents[$i]->department) +count_dl($documents[$i]->describe);
        }
        $docTotal = 0;
        for($i=0;$i<count($docLen);$i++){
            $docTotal = $docTotal + $docLen[$i];
        }
        if(count($docLen) !=0){
            $avdl = $docTotal / count($docLen);
        }else{
            $aval = 1;
        }
        $rank = array();
        $N = count($documents);
        if($N<3000){
            $N = 3000;
        }
        for($i=0;$i<count($documents);$i++){
            $rank[$i] = 0;
            $temp = 0;
            for($j=0;$j<count($keyword);$j++){
                $df = $index_value[$j]["df"];
                if($df == 0){
                    continue;
                }
                $qtf = $index_value[$j]["qtf"];
                $k1 = 1.2;
                $k3 = 1000;
                $b= 0.75;
                $part_a = log((($N-$df+0.5)/$df));
                $part_b = (($k1+1)*$tf[$i][$keyword[$j]])/($k1*(1-$b)+$b*($docLen[$i]/$avdl)+$tf[$i][$keyword[$j]]);
                $part_c = ((($k3+1)*$qtf)/($k3+$qtf));
                $temp = $temp + $part_a*$part_b*$part_c;
            }
            $rank[$i] = $temp;
        }
        $results = array();
        for($i=0;$i<count($documents);$i++){
            if($i<=20){
                if($rank[$i] >= 0){
                    $results[$i]["rank"] = $rank[$i];
                    $results[$i]["document"] = $documents[$i]->ID;
                }
            }else{
                if($rank[$i] > 0){
                    $results[$i]["rank"] = $rank[$i];
                    $results[$i]["document"] = $documents[$i]->ID;
                }
            }
        }
        $_SESSION["document"] = $results;
    }
?>
